import './styles/leftside.css';

const LeftSidebar = () => {
  return (
    <aside className="left-sidebar">
      <ul>
        <li>Product 1</li>
        <li>Product 2</li>
        <li>Product 3</li>
      </ul>
    </aside>
  );
};

export default LeftSidebar;
